import React, { Component } from 'react';
import { Link } from "react-router-dom";
import './Menu.css';

class Menu extends Component {
    render() {
        return (
            <div>
                <header className="header">
                    <a href="https://www.akscoding.com" className="logo">My Tutorial</a>
                    <input className="menu-btn" type="checkbox" id="menu-btn" />
                    <label className="menu-icon" for="menu-btn"><span className="navicon"></span></label>
                    <ul className="menu">
                        <li><Link to="/">Buku</Link></li>
                        <li><Link to="/profile">Profile</Link></li>
                        <li><Link to="/contact">Contact</Link></li>
                        <li><Link to="/documentation">Documentation</Link></li>
                        <li><Link to="/userlist">List User</Link></li>
                        <li><Link to="/datapeminjaman">Peminjaman</Link></li>
                        <li><Link to="/datapengembalian">Pengembalian</Link></li>
                    </ul>
            </header>
        </div>
        );
    }
}

export default Menu;
